import { Modal } from "react-bootstrap";
import StyledFooter from "./Footer";
function CustomModal({ title, body, footer, ...otherProps }) {
  <Modal {...otherProps}>
    {title !== undefined ? (
      <Modal.Header>
        <Modal.Title>{title}</Modal.Title>
      </Modal.Header>
    ) : null}
    {body !== undefined ? <Modal.Body>{body}</Modal.Body> : null}
    {footer !== undefined ? <StyledFooter>{footer}</StyledFooter> : null}
  </Modal>;
}

export default CustomModal;
